import React from 'react'

function TextBox(props){

    function clickHandler(event){
        setState(state.text = syotto.content)
    }

    const state = {
        text: 'T채m채 teksti on laatikossa!'
    }
    
    return(
        <div className="offset-1">
            <input
                type="text"
                value={state.text}
            />
            <div>
                <input type='text' name='syotto'/>
            </div>
            <div>
                <button onClick={clickHandler}>Vaihda Teksti</button>
            </div>
        </div>
    )
}

export default TextBox
